import React from 'react'
import {Route, Routes} from 'react-router-dom'
import { NewTournament } from './NewTournament'

const App=()=>{
  return(
    <>

        <Route path="/" exact component={()=><h1>Home page</h1>}/>
        <Route path="/new" exact component={()=><NewTournament/>} />

    </>
  )
}

export default App
